import React from 'react';
import FlexScreen from '../screens/FlexScreen';
import Ex1 from '../screens/Ex1';
import Ex2 from '../screens/Ex2';
import Ex3 from '../screens/Ex3';
import Ex4 from '../screens/Ex4';
import Ex5 from '../screens/Ex5';
import Ex6 from '../screens/Ex6';
import Ex7 from '../screens/Ex7';

import { createStackNavigator } from '@react-navigation/stack';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';

const Stack = createStackNavigator();
const Tab = createMaterialTopTabNavigator();

export default function FlexStack() {
  return (
    <Stack.Navigator initialRouteName="FlexScreen">
      <Tab.Screen
        name="FlexScreen"
        component={FlexScreen}
        options={{ title: 'FlexScreen' }}
      />
      <Tab.Screen
        name="Ex1"
        component={Ex1}
        options={{ title: 'Ex1' }}
      />
      <Tab.Screen
        name="Ex2"
        component={Ex2}
        options={{ title: 'Ex2' }}
      />
      <Tab.Screen
        name="Ex3"
        component={Ex3}
        options={{ title: 'Ex3' }}
      />
      <Tab.Screen
        name="Ex4"
        component={Ex4}
        options={{ title: 'Ex4' }}
      />
      <Tab.Screen
        name="Ex5"
        component={Ex5}
        options={{ title: 'Ex5' }}
      />
      <Tab.Screen
        name="Ex6"
        component={Ex6}
        options={{ title: 'Ex6' }}
      />
      <Tab.Screen
        name="Ex2"
        component={Ex2}
        options={{ title: 'Ex2' }}
      />
      <Tab.Screen
        name="Ex2"
        component={Ex2}
        options={{ title: 'Ex2' }}
      />
      <Tab.Screen
        name="Ex2"
        component={Ex2}
        options={{ title: 'Ex2' }}
      />
      <Tab.Screen
        name="Ex2"
        component={Ex2}
        options={{ title: 'Ex2' }}
      />
    </Stack.Navigator>

  )
}
